import Footer from "./Footer";
import { useState } from "react";
import { useNavigate } from "react-router-dom";

export default function Signup() {
	const [values, setValues] = useState({
		name: '',
		email: '',
		password: ''
	})
	const [validations, setValidations] = useState({
		name: '',
		email: '',
		password: ''
	})
	const navigate = useNavigate();
	
	const [mobile, setmobile] = useState("");
	const [isError, setIsError] = useState(false);
	const pattern = new RegExp(/^\d{1,10}$/);

	const validateAll = () => {
		const { name, email, password } = values
		const validations = { name: '', email: '', password: '' }
		let isValid = true

		if (!name) {
			validations.name = 'Name is required'
			isValid = false
		}

		if (!email) {
			validations.email = 'Email is required'
			isValid = false
		}

		if (email && !/\S+@\S+\.\S+/.test(email)) {
			validations.email = 'Email format must be as example@mail.com'
			isValid = false
		}

		if (!password) {
			validations.password = 'Password is required'
			isValid = false
		}
		
		if (!isValid) {
			setValidations(validations)
		}

		return isValid
	}

	const validateOne = (e) => {
		const { name } = e.target
		const value = values[name]
		let message = ''

		if (!value) {
			message = `Enter your ${name}`
		}

		if (value && name === 'email' && !/\S+@\S+\.\S+/.test(value)) {
			message = 'Email format must be as example@mail.com'
		}

		setValidations({ ...validations, [name]: message })
	}
	const handleChange = (e) => {
		const { name, value } = e.target
		setValues({ ...values, [name]: value })
	}

	const handleSubmit = (e) => {
		e.preventDefault()

		const isValid = validateAll()

		if (!isValid) {
			return false
		} else {
			navigate('/Login')
		}

		// alert(JSON.stringify(values))
	}

	const { name, email, password } = values

	const {
		name: nameVal,
		email: emailVal,
		password: passwordVal
	} = validations

	return (
		<div className="container mx-auto">
			<div className='login_page'>
				<form onSubmit={handleSubmit} className="form">
					<div className="form-control">
						<label htmlFor="name">Full Name</label>
						<input
							type="text"
							name="name"
							id="name"
							placeholder="Full Name"
							value={name}
							onChange={handleChange}
							onBlur={validateOne}
							className="p-2 border rounded"
						/>
						<small>{nameVal}</small>
					</div>					
					<div className="form-control">
						<label htmlFor="mobile">Mobile</label>
						<input
							type="tel"
							name="mobile"
							id="mobile"
							placeholder="mobile"
							value={mobile}
							onChange={(e) => {
								setmobile(e.target.value);
								if (!pattern.test(e.target.value))
									setIsError(true);
								else setIsError(false);
							}}
							onBlur={validateOne}
							classphone="p-2 border rounded"
						/>
						<small>{isError ? "Invalid Mobile Number" : "+91" + mobile}</small>
					</div>
					<div className="form-control">
						<label htmlFor="email">Email</label>
						<input
							type="email"
							name="email"
							id="email"
							placeholder="Email"
							value={email}
							onChange={handleChange} onBlur={validateOne}
							className="p-2 border rounded"
						/>
						<small>{emailVal}</small>
					</div>
					<div className="form-control">
						<label htmlFor="password">Password</label>
						<input
							type="password"
							name="password"
							id="password"
							placeholder="Password"
							value={password}
							onChange={handleChange} onBlur={validateOne}
							className="p-2 border rounded"
						/>
						<small>{passwordVal}</small>
					</div>
					<button type="submit" className="btn">
						Sign Up
					</button>
				</form>
			</div>
			<Footer />
		</div>
	);
}
